function addTagForm($collectionHolder, $newLinkLi, $collectionHolderScore, $collectionHolderCoef, $deletelink) {
    if ($collectionHolder.data('prototype'))
    {
        // Get the data-prototype explained earlier
        var prototype = $collectionHolder.data('prototype');
        var prototypeScore = $collectionHolderScore.data('prototype');
        var prototypeCoef = $collectionHolderCoef.data('prototype');

        // get the new index
        var index = $collectionHolder.data('index');


        // Replace '$$name$$' in the prototype's HTML to
        // instead be a number based on how many items we have
        var newForm = prototype.replace(/__name__/g, index);
        var newFormScore = prototypeScore.replace(/__name__/g, index);
        var newFormCoef = prototypeCoef.replace(/__name__/g, index);

        // increase the index with one for the next item
        $collectionHolder.data('index', index + 1);

        // Display the form in the page in an li, before the "Add a tag" link li
        var N = index + 1;
        var modal = '<i class="icon-help" id="help'+index+'" data-toggle="modal" data-target="#default"></i>';// <button type="button" class="btn btn-outline-primary block btn-lg" data-toggle="modal" data-target="#default">Launch Modal</button>
        var FC = '<h5 class="form-section" style="text-align:center">Critère</h5><div class="col-md-3"><div class="form-group"><label for="">Critère '+modal+'</label>' + newForm + '</div></div>';
        var FS = '<div class="col-md-3"><div class="form-group"><label for="">Score</label>' + newFormScore + '</div></div>';
        var FCo = '<div class="col-md-3"><div class="form-group"><label for="">coefficient</label>' + newFormCoef + '</div></div>';

        var $newFormLi = $('<div class="row"></div>').append(FC + FS + FCo + '<div></div>');




        // also add a remove button, just for this example
        if ($deletelink == true) {
            $newFormLi.append('<h5><a href="#" class="remove-tag"><i class="icon-android-cancel"></i></a></h5>');
        }

        $newLinkLi.before($newFormLi);


        $('#help'+index).on('click', function(){
            var myModalLabel1 = $('#appbundle_survey_surveys_'+index+'_criteria').val();
            var myModalCollabLabel1 = $('#appbundle_survey_surveysCollaborateur_'+index+'_criteria').val();

            $('#myModalLabel1').html('Aucun critère sélectionné !')
            $('#myModalDescription1').html('')

            if(myModalLabel1)
            {
                $('#myModalLabel1').html($('#criteriaLabel'+myModalLabel1).text())
                $('#myModalDescription1').html($('#criteriaDescription'+myModalLabel1).text())

            }


            if(myModalCollabLabel1)
            {
                $('#myModalLabel1').html($('#criteriaLabel'+myModalCollabLabel1).text())
                $('#myModalDescription1').html($('#criteriaDescription'+myModalCollabLabel1).text())

            }
        })

        calculMoyenne(index);
        calculMoyenneCollaborateur(index);

        // handle the removal, just for this example
        $('.remove-tag').click(function (e) {
            e.preventDefault();

            $(this).parent().parent().remove();


            return false;
        });






        /* ** */
        $(function () {
            $.widget("custom.combobox", {
                _create: function () {
                    this.wrapper = $("<span>")
                        .addClass("custom-combobox")
                        .insertAfter(this.element);

                    this.element.hide();
                    this._createAutocomplete();
                    this._createShowAllButton();
                },

                _createAutocomplete: function () {
                    var selected = this.element.children(":selected"),
                        value = selected.val() ? selected.text() : "";

                    this.input = $("<input>")
                        .appendTo(this.wrapper)
                        .val(value)
                        .attr("title", "")
                        .addClass("custom-combobox-input ui-widget ui-widget-content ui-state-default ui-corner-left")
                        .autocomplete({
                            delay: 0,
                            minLength: 0,
                            source: $.proxy(this, "_source")
                        })
                        .tooltip({
                            classes: {
                                "ui-tooltip": "ui-state-highlight"
                            }
                        });

                    this._on(this.input, {
                        autocompleteselect: function (event, ui) {
                            ui.item.option.selected = true;
                            this._trigger("select", event, {
                                item: ui.item.option
                            });
                        },

                        autocompletechange: "_removeIfInvalid"
                    });
                },

                _createShowAllButton: function () {
                    var input = this.input,
                        wasOpen = false;

                    $("<a>")
                        .attr("tabIndex", -1)
                        .attr("title", "Show All Items")
                        .tooltip()
                        .appendTo(this.wrapper)
                        .button({
                            icons: {
                                primary: "ui-icon-triangle-1-s"
                            },
                            text: false
                        })
                        .removeClass("ui-corner-all")
                        .addClass("custom-combobox-toggle ui-corner-right")
                        .on("mousedown", function () {
                            wasOpen = input.autocomplete("widget").is(":visible");
                        })
                        .on("click", function () {
                            input.trigger("focus");

                            // Close if already visible
                            if (wasOpen) {
                                return;
                            }

                            // Pass empty string as value to search for, displaying all results
                            input.autocomplete("search", "");
                        });
                },

                _source: function (request, response) {
                    var matcher = new RegExp($.ui.autocomplete.escapeRegex(request.term), "i");
                    response(this.element.children("option").map(function () {
                        var text = $(this).text();
                        if (this.value && ( !request.term || matcher.test(text) ))
                            return {
                                label: text,
                                value: text,
                                option: this
                            };
                    }));
                },

                _removeIfInvalid: function (event, ui) {

                    // Selected an item, nothing to do
                    if (ui.item) {
                        return;
                    }

                    // Search for a match (case-insensitive)
                    var value = this.input.val(),
                        valueLowerCase = value.toLowerCase(),
                        valid = false;
                    this.element.children("option").each(function () {
                        if ($(this).text().toLowerCase() === valueLowerCase) {
                            this.selected = valid = true;
                            return false;
                        }
                    });

                    // Found a match, nothing to do
                    if (valid) {
                        return;
                    }

                    // Remove invalid value
                    this.input
                        .val("")
                        .attr("title", value + " didn't match any item")
                        .tooltip("open");
                    this.element.val("");
                    this._delay(function () {
                        this.input.tooltip("close").attr("title", "");
                    }, 2500);
                    this.input.autocomplete("instance").term = "";
                },

                _destroy: function () {
                    this.wrapper.remove();
                    this.element.show();
                }
            });

            $("#appbundle_survey_collaborateur").combobox({
                select: function( event, ui ) {
                    var id = ui.item.value
                    $.ajax({
                        method: "GET",
                        url: window.location+"/getEval/"+id
                    })
                        .done(function( msg ) {
                            $.each(msg, function( index, value ) {
                                if(value == true) {
                                    var url =  window.location+"/"+id;
                                    window.location.href = url;
                                }
                            });
                            //alert( "Data Saved: " + msg );
                        });
                }
            });

            $("#appbundle_survey_customer").combobox({
                select: function( event, ui ) {
                    var id = ui.item.value
                    $.ajax({
                        method: "GET",
                        url: window.location+"/getEval/"+id
                    })
                        .done(function( msg ) {
                            $.each(msg, function( index, value ) {
                                if(value == true) {
                                    var url =  window.location+"/"+id;
                                    window.location.href = url;
                                }
                            });
                            //alert( "Data Saved: " + msg );
                        });
                }
            });

        });


    }
}
